// import { Link, useHistory } from 'react-router-dom';
import AssociationNav from './AssociationNav';

const AssociationHome = () => {
  return (
    <>
        <div className='association-home'>
            <AssociationNav/> 
            <div>AssociationHome</div>
        </div>
    </>
  )
}

export default AssociationHome
